import React from "react";

class Footer extends React.Component {
    render() {
        return (
            <footer id="footer_text">
                <p>Domino componentes React, estado global com Redux, requisições API, bibliotecas e Javascript Vanilla. </p>
            </footer>
        )
    }
}

export default Footer;
